, "zip": "07032", "region": "EAST", "enabled": true}, {"id": "R63461", "label": "SureGoÈÄÄË¥ßÊ£ÄÊµã-Áæé‰∏≠ÂØÜËãèÈáå63461ÈÄÄË¥ß‰ªì", "zip": "63461", "region": "RETURN", "enabled": false}], "channel_allow": {"GOFO-Êä•‰ª∑": ["WEST", "CENTRAL"], "GOFO„ÄÅUNIUNI-MT-Êä•‰ª∑": ["WEST", "CENTRAL"], "USPS-YSD-Êä•‰ª∑": ["WEST", "CENTRAL"], "FedEx-632-MT-Êä•‰ª∑": ["WEST", "CENTRAL", "EAST"], "FedEx-MT-Ë∂ÖÂ§ßÂåÖË£π-Êä•‰ª∑": ["WEST", "CENTRAL", "EAST"], "FedEx-ECO-MTÊä•‰ª∑": ["WEST", "CENTRAL", "EAST"], "FedEx-MT-Âç±Èô©ÂìÅ-Êä•‰ª∑": ["CENTRAL", "EAST"], "GOFOÂ§ß‰ª∂-MT-Êä•‰ª∑": ["WEST", "EAST"], "XLmiles-Êä•‰ª∑": ["WEST"]}, "fees": {"res": {"FedEx-632-MT-Êä•‰ª∑": 2.61, "FedEx-MT-Ë∂ÖÂ§ßÂåÖË£π-Êä•‰ª∑": 2.61, "FedEx-MT-Âç±Èô©ÂìÅ-Êä•‰ª∑": 3.32, "GOFOÂ§ß‰ª∂-MT-Êä•‰ª∑": 2.93}, "sig": {"XLmiles-Êä•‰ª∑": 10.2, "FedEx-632-MT-Êä•‰ª∑": 4.37, "FedEx-MT-Âç±Èô©ÂìÅ-Êä•‰ª∑": 9.71, "FedEx-MT-Ë∂ÖÂ§ßÂåÖË£π-Êä•‰ª∑": 4.37}}, "fuel_config": {"channels": ["FedEx-632-MT-Êä•‰ª∑", "FedEx-MT-Ë∂ÖÂ§ßÂåÖË£π-Êä•‰ª∑", "FedEx-MT-Âç±Èô©ÂìÅ-Êä•‰ª∑", "GOFOÂ§ß‰ª∂-MT-Êä•‰ª∑"], "discount_85": ["FedEx-632-MT-Êä•‰ª∑", "FedEx-MT-Ë∂ÖÂ§ßÂåÖË£π-Êä•‰ª∑"]}};
    document.getElementById('date').innerText = new Date().toLocaleDateString();

    // ÂàùÂßãÂåñ‰ªìÂ∫ì
    const whSel = document.getElementById('warehouse');
    DATA.warehouses.forEach(w => {
        let opt = document.createElement('option');
        opt.value = w.id;
        opt.text = w.label;
        whSel.add(opt);
    });

    let CUR_ZONES = {};

    // Ê†áÂáÜÂåñÈáçÈáè
    function stdWt(v, unit) {
        v = parseFloat(v) || 0;
        if (unit === 'oz') return v / 16;
        if (unit === 'kg') return v / 0.453592;
        return v;
    }

    // ËÆ°ÁÆó FedEx Zone (ÁÆÄÂåñÁâà: 3‰ΩçÈÇÆÁºñÂ∑Æ)
    function calcFedExZone(dest, origin) {
        if (!dest || dest.length < 3) return null;
        let d = parseInt(dest.substring(0,3));
        let o = parseInt(origin.substring(0,3));
        let diff = Math.abs(d - o);
        // ÁÆÄÂçïÊ®°Êãü: ÂÆûÈôÖÂ∫î‰ΩøÁî®ÂÆåÊï¥ Zone Ë°®
        if (diff < 5) return 2;
        if (diff < 20) return 3;
        if (diff < 40) return 4;
        if (diff < 60) return 5;
        if (diff < 80) return 6;
        if (diff < 90) return 7;
        return 8;
    }

    function calc() {
        const zip = document.getElementById('zipCode').value.trim();
        const tier = document.querySelector('input[name="tier"]:checked').value;
        const whId = whSel.value;
        const wh = DATA.warehouses.find(w => w.id === whId);
        const isRes = document.getElementById('addressType').value === 'res';
        const isSig = document.getElementById('sigToggle').checked;
        
        const pkg = {
            L: parseFloat(document.getElementById('L').value)||0,
            W: parseFloat(document.getElementById('W').value)||0,
            H: parseFloat(document.getElementById('H').value)||0,
            Wt: stdWt(document.getElementById('Wt').value, document.getElementById('WtUnit').value)
        };

        if (pkg.Wt <= 0) return;

        document.getElementById('resTierBadge').innerText = tier;
        document.getElementById('pkgSummary').innerHTML = `<b>${pkg.L}x${pkg.W}x${pkg.H}"</b> | ÂÆûÈáç: ${pkg.Wt.toFixed(2)} lb`;

        const tbody = document.getElementById('resBody');
        tbody.innerHTML = '';

        if (!wh.enabled) {
            tbody.innerHTML = '<tr><td colspan="6" class="text-muted">ËØ•‰ªìÂ∫ìÊöÇ‰∏çÊîØÊåÅÂú®Á∫øÊä•‰ª∑</td></tr>';
            return;
        }

        const tierData = DATA.tiers[tier];
        if (!tierData) return;

        // ÈÅçÂéÜÊâÄÊúâÊ∏†ÈÅì
        for (let ch in DATA.channel_allow) {
            // 1. Ê£ÄÊü•‰ªìÂ∫ìÊùÉÈôê
            if (!DATA.channel_allow[ch].includes(wh.region)) continue;

            // 2. ÂáÜÂ§áÊï∞ÊçÆ
            let chData = tierData[ch];
            if (!chData && ch !== "GOFO„ÄÅUNIUNI-MT-Êä•‰ª∑") continue; // Combo ÁâπÊÆäÂ§ÑÁêÜ

            // Â§ÑÁêÜ Combo (ÊãÜÂàÜÊàê‰∏§Ë°å)
            let subChannels = [];
            if (ch === "GOFO„ÄÅUNIUNI-MT-Êä•‰ª∑") {
                if (tierData[ch]) {
                    subChannels.push({name: "GOFO-MT", data: tierData[ch].gofo});
                    subChannels.push({name: "UNIUNI-MT", data: tierData[ch].uni});
                }
            } else {
                subChannels.push({name: ch, data: chData});
            }

            subChannels.forEach(sub => {
                let prices = (sub.data.type === 'dual') ? (isRes ? sub.data.res : sub.data.com) : sub.data.prices;
                if (!prices) return;

                // 3. Á°ÆÂÆö Zone
                let zone = '-';
                if (ch.includes('FedEx') || ch.includes('XLmiles') || ch.includes('GOFOÂ§ß‰ª∂')) {
                    // ‰ΩøÁî®ËÆ°ÁÆó Zone (ÈúÄÂÆåÂñÑÁÆóÊ≥ïÔºåÊöÇÊó∂Ê®°Êãü)
                    let z = calcFedExZone(zip, wh.zip);
                    if (z) zone = z.toString();
                } else {
                    // ‰ΩøÁî®Êü•Ë°® Zone
                    if (CUR_ZONES[ch]) zone = CUR_ZONES[ch];
                }

                // 4. ËÆ°ÁÆóËÆ°Ë¥πÈáç
                let dimW = (pkg.L * pkg.W * pkg.H) / 250; // ÈªòËÆ§Èô§250? Ê†πÊçÆËßÑÂàôË∞ÉÊï¥
                // UNIUNI Êó†‰ΩìÁßØÈáç
                if (sub.name.includes('UNIUNI')) dimW = 0;
                // FedEx/GOFO ‰∏ÄËà¨ 250 Êàñ 139? ÂÅáËÆæ 250 (Âéü‰ª£Á†ÅÈÄªËæëÊú™ÁªÜÂåñÔºåÊöÇÂÆö)
                if (ch.includes('ECO')) dimW = (pkg.L * pkg.W * pkg.H) / 250; 
                
                let billWt = Math.max(pkg.Wt, dimW);
                billWt = Math.ceil(billWt); // Âêë‰∏äÂèñÊï¥

                // 5. Êü•Âü∫Á°Ä‰ª∑
                let basePrice = 0;
                let zoneKey = zone;
                // ‰øÆÊ≠£ Zone Êò†Â∞Ñ (‰æãÂ¶Ç Excel Ë°®Â§¥ÊòØ 2,3,4...)
                if (zone == '1') zoneKey = '2'; 

                let row = prices.find(p => p.w >= billWt);
                if (row && row[zoneKey]) basePrice = row[zoneKey];

                if (basePrice > 0) {
                    let total = basePrice;
                    let details = [];

                    // ‰ΩèÂÆÖË¥π
                    if (isRes && DATA.fees.res[ch]) {
                        let rf = DATA.fees.res[ch];
                        total += rf;
                        details.push(`‰ΩèÂÆÖ:${rf}`);
                    }

                    // Á≠æÂêçË¥π
                    if (isSig && DATA.fees.sig[ch]) {
                        let sf = DATA.fees.sig[ch];
                        total += sf;
                        details.push(`Á≠æÂêç:${sf}`);
                    }

                    // ÁáÉÊ≤πË¥π
                    if (DATA.fuel_config.channels.includes(ch)) {
                        let rate = 0;
                        if (ch.includes('GOFOÂ§ß‰ª∂')) {
                            rate = parseFloat(document.getElementById('gofoFuel').value) / 100;
                            // GOFOÂ§ß‰ª∂ÂÖ¨Âºè: (ËøêË¥π+ÊùÇË¥π) * ÁáÉÊ≤πÁéá
                            let fuelAmt = total * rate; 
                            total += fuelAmt;
                            details.push(`ÁáÉÊ≤π:${fuelAmt.toFixed(2)}`);
                        } else {
                            rate = parseFloat(document.getElementById('fedexFuel').value) / 100;
                            if (DATA.fuel_config.discount_85.includes(ch)) {
                                rate = rate * 0.85;
                            }
                            // FedEx: Âü∫Á°ÄËøêË¥π * ÁáÉÊ≤πÁéá
                            let fuelAmt = basePrice * rate;
                            total += fuelAmt;
                            details.push(`ÁáÉÊ≤π:${fuelAmt.toFixed(2)}`);
                        }
                    }

                    tbody.innerHTML += `
                        <tr>
                            <td class="text-start fw-bold">${sub.name}</td>
                            <td>Z${zone}</td>
                            <td>${billWt}</td>
                            <td>${basePrice.toFixed(2)}</td>
                            <td class="small text-muted text-start">${details.join(' | ') || '-'}</td>
                            <td class="price-text">$${total.toFixed(2)}</td>
                        </tr>
                    `;
                }
            });
        }
    }

    // ‰∫ã‰ª∂ÁªëÂÆö
    document.getElementById('btnLookup').onclick = () => {
        let z = document.getElementById('zipCode').value.trim();
        if (DATA.zip_db[z]) {
            let i = DATA.zip_db[z];
            document.getElementById('locInfo').innerText = `‚úÖ ${i.s} - ${i.c}`;
            CUR_ZONES = i.z;
        } else {
            document.getElementById('locInfo').innerText = "‚ùå Êú™ÊâæÂà∞";
            CUR_ZONES = {};
        }
    };

    document.getElementById('btnCalc').onclick = calc;
    document.querySelectorAll('.tier-radio').forEach(r => r.onchange = () => {
        if(document.getElementById('Wt').value) calc();
    });

</script>
